top.value:
1. Collate data from multiple sources to quantitatively measure the fragmentation of health financing systems in Brazil, Colombia, India and Mexico;
2. Understand the nature of health financing fragmentation and how this varies within and between health systems in the four countries;
3. Assess whether fragmentation is associated with progress towards health systems goals including universal health coverage, quality, improved health and financial protection;
4. Understand how factors such as local governance arrangements and major events such as COVID-19 have affected health system fragmentation and related achievement of health system goals;
5. Evaluate recent health system reforms in Brazil, Colombia, India and Mexico and measures health system and health impacts;
6. Document key political and institutional drivers of health financing fragmentation and identify enablers and hurdles for policy reform;
7. Strengthen collaborations between collaborating institutions and build capacity for longer-term health systems research;
8. Engaged communities and stakeholders throughout the research to foster uptake and increase policy relevance.
